(1,'Java Web Media','Pusat Kursus Private Web Programming, Mobile Programming, Graphic Design dan Statistik','CV Java Web Media','<p>Java Web Media adalah Pusat Kursus Private dan Reguler bidang Desain Grafis, Web Programming, Mobile Application dan Statistik</p>','Hotel Bumi Wiyata is a three stars hotel that located on Jl. Margonda Raya Depok 16423 West Java.Â \r\n\r\nHotel Bumi Wiyata has 13 ha areas and 91 Rooms which divided into six types of room; Standard Room, Superior Room, Deluxe Superior Room, Suite Room, Deluxe Suite Room & Executive Room.\r\n\r\nHotel Bumi Wiyata is the perfect choice for your business activity, gathering, wedding, outbound and family. With the concept of the greatest hotel for recreational meeting surrounding with traditional nature, various facilities and warm hospitality will makes all your event become a memorable one.','http://javawebmedia.com','contact@javawebmedia.co.id','bmwiyata@hotelbumiwiyata.com','<p>Jl. Marsda Adisucipto Yogyakarta 55281</p>','+6285715100485','+6281210697841','+6285715100485','logo-uin.png','uin.png','footer1.png','Java Web Media adalah Pusat Kursus Private dan Reguler bidang Desain Grafis, Web Programming, Mobile Application dan Statistik\r\n','','https://www.facebook.com/javawebmedia','http://twitter.com/javawebmedia','https://instagram.com/javawebmedia','https://www.youtube.com/channel/UCmm6mFZXYQ3ZylUMa0Tmc2Q','<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d31624.568041768387!2d110.39586093694824!3d-7.782296482619054!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x7f35156a4aeb645a!2sUIN%20Sunan%20Kalijaga%20Yogyakarta!5e0!3m2!1sen!2sid!4v1617170981130!5m2!1sen!2sid\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>','Bersedekah untuk anak yatim','fa-money','Pengasuh yang santun','fa-thumbs-up','Jadwal Flexibel','fa-adn','Menjaga Amanah','fa-check-square-o','Tempat belajar nyaman','fa-home','Online service','fa-laptop','Berbagi kebahagiaan dengan anak yatim adalah perintah Allah dan rasul','Pengasuh yang baik dan santun serta memberikan teladan yang baik bagi anak asuh','Bagi Anda siswa yang ingin belajar, kami menerapkan jadwal flexibel','Kami senantiasa menjaga amanah yang diberikan kepada donatur agar sampai di tangan yang berhak.','Kami menyediakan tempat belajar yang nyaman dan menyenangkan','Website kamu selalu uptodate, Anda bisa mengunduh apa yang dipelajari','','','','','','','<p>Berawal dari keinginan ibunda Hj.Masah Muhari diakhir hidupnya untuk mewakaan sebagian hartanya dijalan Allah, gayungpun bersambut pada bulan Mei 2011 saat kami akan melaksanakan ibadah umrah, Seorang rekan kami sesama Jamaah bernama ustadzah Hj. Zainur Fahmid memberikan informasi Tentang Anggota yang hendak mewakaan sebidang tanahnya di wilayah Beji Timur. Kami pun memanjatkan doa di kota suci dengan penuh rasa harap pertolongan Allah untuk menunjukan jalan terbaik-Nya, maka sepulang umroh kami mengadakan pertemuan di kediaman Ibu Dra Hj Ratna Mardjanah untuk membicarakan visi misi kami dalam wakaf tersebut dan sepakat untuk mendirikan Istana Yatim Riyadhul Jannah ini.</p>\r\n<p>Nama Riyadhul Jannah Sendiri diambil dari nama pengelola wakaf (H. Ahmad Riyadh Muchtar, Lc) dan pemberi wakaf (Dra Hj Ratna Mardjanah). Istana Yatim Riyadhul Jannah hadir untuk melayani dan memfasilitasi segala kebutuhan anak yatim, terutama pendidikan agama, akhlak dan kehidupan yang layak untuk bekal masa depan mereka yang cerah agar bisa memberi manfaat bagi umat. Harapan kami semoga dengan membangunkan istana untuk anak yatim, maka Allah akan berikan istana-Nya di surga kelak dan kita termasuk manusia yang bisa memberika manfaat bagi sesama sebagaimana sabda Rasulullah SAW yang artinya:&nbsp;</p>\r\n<p>&ldquo;Sebaik-baik manusia adalah yang paling bermanfaat bagi manusia lainnya&rdquo;&nbsp;</p>\r\n<p>erimakasih atas segala bentuk bantuan yang dipercayakan kepada kami baik secara materi, tenaga dan kiran serta doa para muhsinin dan muhsinat Istana Yatim Riyadhul Jannah selama ini, mulai dari rencana pendirian hingga berkembang seperti saat ini. Semoga segala amal menjadi shadaqah jariyah disisi-Nya.&nbsp;</p>\r\n<p>&nbsp;</p>','istana-yatim.png','fsH_KhUWfho','<table id=\"dataTables-example\" class=\"table table-bordered\" width=\"100%\">\r\n<thead>\r\n<tr>\r\n<th tabindex=\"0\" colspan=\"1\" rowspan=\"1\" width=\"19%\">Nama Bank</th>\r\n<th tabindex=\"0\" colspan=\"1\" rowspan=\"1\" width=\"21%\">Nomor Rekening</th>\r\n<th tabindex=\"0\" colspan=\"1\" rowspan=\"1\" width=\"7%\">Atas nama</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>BCA KCP Margo City</td>\r\n<td>4212548204</td>\r\n<td>Andoyo</td>\r\n</tr>\r\n<tr>\r\n<td>Bank Mandiri KCP Universitas Indonesia</td>\r\n<td>1570001807768</td>\r\n<td>Eflita Meiyetriani</td>\r\n</tr>\r\n<tr>\r\n<td>Bank BNI Syariah Kantor Cabang Jakarta Selatan</td>\r\n<td>0105301001</td>\r\n<td>Eflita Meiyetriani</td>\r\n</tr>\r\n</tbody>\r\n</table>','balairung-budiutomo-01.jpg','Aktif',3,'Sigit Yuwono Wachid','Direktur','tanda-tangan-nba.png','smtp','ssl://mail.websitemu.com',465,7,'contact@websitemu.com','muhammad',0,'2021-03-31 13:12:36');
